/**
 * Created by Lenovo on 2019/8/18.
 */
import React from 'react';
import classnames from 'classnames';
import './index.css';
import {defaultProps} from './defaultProps';
export default class Button extends React.Component {
    static defaultProps = defaultProps;
    constructor(props) {
        super(props);
    }
    onClick(index,item) {
        const {onClick} =this.props;
        if (onClick) {
            onClick();
        }
    }
    render() {
        const {prefixCls,type,children,className} =this.props;
        switch (type){
            case "primary":
                return(
                        <div className={classnames(prefixCls,className)}>
                            <span className={prefixCls+'-btn'} onClick={()=>this.onClick()}>{children}</span>
                        </div>
                );
            case "fill":
                return(
                    <div className={prefixCls+'-btn-fill'+className} onClick={() => this.onClick()}>{children}</div>
                );
            default:
                return(
                    <div className={classnames(prefixCls,className)}>
                        <span className={prefixCls+'-btn'} onClick={()=>this.onClick()}>{children}</span>
                    </div>
                )
        }
    }
}
